import { Link } from "react-router-dom"

export const Ectenias = ({ setElement, list }) => {
  return (
    <>
      <ul className="library">
        {list.map((item) => (
          <li className="library__element">
            <Link 
              to={item.path} 
              className="itemLink"
              onClick={() => setElement(item)}
            >
              {item.path}
            </Link>
          </li>
        ))}
      </ul>
    </>
  )
}
